import React from "react";
import "./App.css";
import {Home} from "./pages/Home";
import {Source} from "./pages/Source";
import {About} from "./pages/About";
import {Developer} from "./pages/Developer";
import {Nav} from "./pages/Nav";
import {Foot} from "./pages/Foot"


import {
  Routes,
  Route,
  Navigate
} from "react-router-dom";

const App = () => {
  return (
      <div className="App">
        <Nav />
        <Routes>
          <Route path="/tic-tac-toe-ai-game-app/home" exact element ={<Home />} />
          <Route path="/tic-tac-toe-ai-game-app/source-code" element={<Source />} />
          <Route path="/tic-tac-toe-ai-game-app/about" element={<About />} />
          <Route path="/tic-tac-toe-ai-game-app/developer" element={<Developer />} />
          <Route path="*" element={<Navigate to="/tic-tac-toe-ai-game-app/home" replace />} />
        </Routes>
        <Foot/>
      </div>
  );
}

export default App;
